import './style.css'
export default function Theme() {
    return (
      <div className="Theme">
        <h1>React Themes Demo</h1>
        <div className='btn'>
        <button con>Dark</button><button>Light</button><button>Party</button>
        </div>
        <img src={logo} className="App-logo" alt="logo" />
      </div>
    )
  }
